import React, {Component} from 'react';
import './App.css';
import {BrowserRouter, Switch} from 'react-router-dom';
import Home from './Containers/Home/Home';
import About from './Containers/About/About';
import Shop from './Containers/Shop/Shop';
import { Route} from 'react-router-dom';
import ProductList from './Components/Shop/ProductList';
import ProductItem from './Components/Shop/ProductItem';
import TopImg from "./Components/Shop/topImg.png";
import Aux from "react-aux";


class App extends Component {



  render() {
    return (
    <div className="App">
      <BrowserRouter>


      <Route path="/" exact component={Home} />
      <Route path="/about" component={About} />

      <Route path="/shop" render={ (props) => <Shop></Shop>}/>

      <Switch>

      <Route path="/shop/:category/:id" render={ (props) =>{<Aux><img className="shop__topImg" src={TopImg} alt="graphics"/><ProductItem {...props}/></Aux>}}/>
      <Route path="/shop/:category" render={ (props) => <ProductList {...props}/>}/>

      </Switch>
      </BrowserRouter>
    </div>

  );
  }
}


export default App;
